import React from "react";
import Logo from "../img/finallogo.png";
function Footer() {
  return (
    <footer className="footer">
      <div className="container">
        <div className="row">
          <div className="col">
          <div className="logo">
          <img src={Logo} alt="Logo" /> 
        </div>
          </div>
        </div>
      </div>
    </footer>
  );
}

export default Footer;
